import{_ as e,c as a,o as r,a2 as t}from"./chunks/framework.CSd21wiM.js";const g=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"examples.md","filePath":"examples.md"}'),s={name:"examples.md"},o=t('<p>We have set up many examples using different libraries and frameworks. Each example has a <code>lagoss-dev</code> script that uses <a href="./cli.html#lagoss-dev"><code>lagoss dev</code></a> to start the example locally, in a few seconds.</p><h2 id="basics" tabindex="-1">Basics <a class="header-anchor" href="#basics" aria-label="Permalink to &quot;Basics&quot;">​</a></h2><h3 id="fetch-an-api" tabindex="-1">Fetch an API <a class="header-anchor" href="#fetch-an-api" aria-label="Permalink to &quot;Fetch an API&quot;">​</a></h3><p>This example uses <a href="./runtime-apis.html#fetch"><code>fetch()</code></a> to fetch an API and return the result. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/fetch-api" target="_blank" rel="noreferrer">See the code</a></p><h3 id="reply-with-html" tabindex="-1">Reply with HTML <a class="header-anchor" href="#reply-with-html" aria-label="Permalink to &quot;Reply with HTML&quot;">​</a></h3><p>This example replies with HTML, setting the proper <code>Content-Type</code> header. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/reply-with-html" target="_blank" rel="noreferrer">See the code</a></p><h3 id="reply-with-json" tabindex="-1">Reply with JSON <a class="header-anchor" href="#reply-with-json" aria-label="Permalink to &quot;Reply with JSON&quot;">​</a></h3><p>This example replies with JSON, setting the proper <code>Content-Type</code> header. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/reply-with-json" target="_blank" rel="noreferrer">See the code</a></p><h2 id="libraries" tabindex="-1">Libraries <a class="header-anchor" href="#libraries" aria-label="Permalink to &quot;Libraries&quot;">​</a></h2><h3 id="drizzle-with-turso" tabindex="-1">Drizzle with Turso <a class="header-anchor" href="#drizzle-with-turso" aria-label="Permalink to &quot;Drizzle with Turso&quot;">​</a></h3><p>This example uses <a href="https://github.com/drizzle-team/drizzle-orm" target="_blank" rel="noreferrer">Drizzle</a>, a TypeScript ORM that has a SQL-like syntax with <a href="https://turso.tech" target="_blank" rel="noreferrer">Turso</a> as a distributed SQLite database, with typesafe queries and migrations. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/drizzle-turso" target="_blank" rel="noreferrer">See the code</a></p><h3 id="hattip" tabindex="-1">HatTip <a class="header-anchor" href="#hattip" aria-label="Permalink to &quot;HatTip&quot;">​</a></h3><p>This example uses <a href="https://github.com/hattipjs/hattip" target="_blank" rel="noreferrer">HatTip</a>, a minimalist express-like library that runs anywhere, via Lagoss&#39;s adapter. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/hattip" target="_blank" rel="noreferrer">See the code</a></p><h3 id="hono" tabindex="-1">Hono <a class="header-anchor" href="#hono" aria-label="Permalink to &quot;Hono&quot;">​</a></h3><p>This example uses <a href="https://honojs.dev" target="_blank" rel="noreferrer">Hono</a>, a small, simple, and ultrafast web framework, via Lagoss&#39;s adapter. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/hono" target="_blank" rel="noreferrer">See the code</a></p><h3 id="nitro" tabindex="-1">Nitro <a class="header-anchor" href="#nitro" aria-label="Permalink to &quot;Nitro&quot;">​</a></h3><p>This example uses <a href="https://nitro.unjs.io/" target="_blank" rel="noreferrer">Nitro</a>, a library to build and deploy universal JavaScript servers, via Lagoss&#39;s preset. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/nitro" target="_blank" rel="noreferrer">See the code</a></p><h3 id="neon" tabindex="-1">Neon <a class="header-anchor" href="#neon" aria-label="Permalink to &quot;Neon&quot;">​</a></h3><p>This example uses <a href="https://neon.tech" target="_blank" rel="noreferrer">Neon</a> with their Serverless driver (<code>@neondatabase/serverless</code>) to make PostgreSQL queries on the edge. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/neon" target="_blank" rel="noreferrer">See the code</a></p><h3 id="planetscale-serverless-driver" tabindex="-1">PlanetScale Serverless Driver <a class="header-anchor" href="#planetscale-serverless-driver" aria-label="Permalink to &quot;PlanetScale Serverless Driver&quot;">​</a></h3><p>This example uses <a href="https://planetscale.com" target="_blank" rel="noreferrer">PlanetScale</a> with their Serverless Driver (<code>@planetscale/database</code>) to make SQL queries on the edge. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/planetscale" target="_blank" rel="noreferrer">See the code</a></p><h3 id="preact-csr" tabindex="-1">Preact CSR <a class="header-anchor" href="#preact-csr" aria-label="Permalink to &quot;Preact CSR&quot;">​</a></h3><p>This example uses <a href="https://preactjs.com" target="_blank" rel="noreferrer">Preact</a> to client-side render an app. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/preact" target="_blank" rel="noreferrer">See the code</a></p><h3 id="preact-srr" tabindex="-1">Preact SRR <a class="header-anchor" href="#preact-srr" aria-label="Permalink to &quot;Preact SRR&quot;">​</a></h3><p>This example uses <a href="https://preactjs.com" target="_blank" rel="noreferrer">Preact</a> to server-side render an app and hydrate on the client. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/preact-ssr" target="_blank" rel="noreferrer">See the code</a></p><h3 id="react-csr" tabindex="-1">React CSR <a class="header-anchor" href="#react-csr" aria-label="Permalink to &quot;React CSR&quot;">​</a></h3><p>This example uses <a href="https://reactjs.org" target="_blank" rel="noreferrer">React</a> to client-side render an app. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/react" target="_blank" rel="noreferrer">See the code</a></p><h3 id="react-ssr" tabindex="-1">React SSR <a class="header-anchor" href="#react-ssr" aria-label="Permalink to &quot;React SSR&quot;">​</a></h3><p>This example uses <a href="https://reactjs.org" target="_blank" rel="noreferrer">React</a> to server-side render an app and hydrate on the client. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/react-ssr" target="_blank" rel="noreferrer">See the code</a></p><h3 id="react-ssr-with-streaming" tabindex="-1">React SSR with streaming <a class="header-anchor" href="#react-ssr-with-streaming" aria-label="Permalink to &quot;React SSR with streaming&quot;">​</a></h3><p>This example uses <a href="https://reactjs.org" target="_blank" rel="noreferrer">React</a> to server-side render an app, stream the HTML, and hydrate on the client. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/react-streaming" target="_blank" rel="noreferrer">See the code</a></p><h3 id="satori" tabindex="-1">Satori <a class="header-anchor" href="#satori" aria-label="Permalink to &quot;Satori&quot;">​</a></h3><p>This example uses <a href="https://github.com/vercel/satori" target="_blank" rel="noreferrer">Satori</a> to render React and HTML/CSS to SVG. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/satori" target="_blank" rel="noreferrer">See the code</a></p><h3 id="sidra" tabindex="-1">Sidra <a class="header-anchor" href="#sidra" aria-label="Permalink to &quot;Sidra&quot;">​</a></h3><p>This example uses <a href="https://npmjs.com/sidra" target="_blank" rel="noreferrer">Sidra</a>, a library to create servers using TypeScript decorators with NestJS-like API. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/sidra" target="_blank" rel="noreferrer">See the code</a></p><h3 id="turso" tabindex="-1">Turso <a class="header-anchor" href="#turso" aria-label="Permalink to &quot;Turso&quot;">​</a></h3><p>This example uses <a href="https://turso.tech" target="_blank" rel="noreferrer">Turso</a> to make SQLite queries on the edge. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/turso" target="_blank" rel="noreferrer">See the code</a></p><h3 id="trpc" tabindex="-1">tRPC <a class="header-anchor" href="#trpc" aria-label="Permalink to &quot;tRPC&quot;">​</a></h3><p>This example uses <a href="https://trpc.io" target="_blank" rel="noreferrer">tRPC</a> server, to build typesafe APIs. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/trpc" target="_blank" rel="noreferrer">See the code</a></p><h3 id="upstash-redis" tabindex="-1">Upstash Redis <a class="header-anchor" href="#upstash-redis" aria-label="Permalink to &quot;Upstash Redis&quot;">​</a></h3><p>This example uses <a href="https://github.com/upstash/upstash-redis" target="_blank" rel="noreferrer">Upstash Redis</a> to make Redis requests over HTTP. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/upstash" target="_blank" rel="noreferrer">See the code</a></p><h3 id="upstash-rate-limit" tabindex="-1">Upstash Rate Limit <a class="header-anchor" href="#upstash-rate-limit" aria-label="Permalink to &quot;Upstash Rate Limit&quot;">​</a></h3><p>This example uses <a href="https://github.com/upstash/ratelimit" target="_blank" rel="noreferrer">Upstash Rate Limit</a> to easily create rate limits via Redis over HTTP. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/upstash-ratelimit" target="_blank" rel="noreferrer">See the code</a></p><h3 id="vite-plugin-ssr" tabindex="-1">vite-plugin-ssr <a class="header-anchor" href="#vite-plugin-ssr" aria-label="Permalink to &quot;vite-plugin-ssr&quot;">​</a></h3><p>This example uses <a href="https://vite-plugin-ssr.com/" target="_blank" rel="noreferrer">vite-plugin-ssr</a> to render static and dynamic React pages. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/vite-plugin-ssr" target="_blank" rel="noreferrer">See the code</a></p><h3 id="xata" tabindex="-1">Xata <a class="header-anchor" href="#xata" aria-label="Permalink to &quot;Xata&quot;">​</a></h3><p>This example uses <a href="https://xata.io" target="_blank" rel="noreferrer">Xata</a>, a modern serverless type-safe database. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/xata" target="_blank" rel="noreferrer">See the code</a></p><h2 id="frameworks" tabindex="-1">Frameworks <a class="header-anchor" href="#frameworks" aria-label="Permalink to &quot;Frameworks&quot;">​</a></h2><h3 id="astro" tabindex="-1">Astro <a class="header-anchor" href="#astro" aria-label="Permalink to &quot;Astro&quot;">​</a></h3><p>This example uses <a href="https://astro.build" target="_blank" rel="noreferrer">Astro</a>, a static site generator, with both SSR via Lagoss&#39;s adapter and prerendering. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/astro" target="_blank" rel="noreferrer">See the code</a></p><h3 id="nuxt" tabindex="-1">Nuxt <a class="header-anchor" href="#nuxt" aria-label="Permalink to &quot;Nuxt&quot;">​</a></h3><p>This example uses <a href="https://nuxt.com" target="_blank" rel="noreferrer">Nuxt</a>, the intuitive web framework for Vue, with SSR via Lagoss&#39;s preset. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/nuxt" target="_blank" rel="noreferrer">See the code</a></p><h3 id="nuxt-complex" tabindex="-1">Nuxt Complex <a class="header-anchor" href="#nuxt-complex" aria-label="Permalink to &quot;Nuxt Complex&quot;">​</a></h3><p>This example uses <a href="https://nuxt.com" target="_blank" rel="noreferrer">Nuxt</a> with multiple pages, layouts, api routes and more. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/nuxt-complex" target="_blank" rel="noreferrer">See the code</a></p><h3 id="rakkas" tabindex="-1">Rakkas <a class="header-anchor" href="#rakkas" aria-label="Permalink to &quot;Rakkas&quot;">​</a></h3><p>This example uses <a href="https://rakkasjs.org" target="_blank" rel="noreferrer">Rakkas</a>, a React framework powered by Vite, with SSR via Lagoss&#39;s adapter. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/rakkas" target="_blank" rel="noreferrer">See the code</a></p><h3 id="remix" tabindex="-1">Remix <a class="header-anchor" href="#remix" aria-label="Permalink to &quot;Remix&quot;">​</a></h3><p>This example uses <a href="https://remix.run" target="_blank" rel="noreferrer">Remix</a>, a full-stack React framework, with SSR via Lagoss&#39;s integration. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/remix" target="_blank" rel="noreferrer">See the code</a></p><h3 id="sveltekit" tabindex="-1">SvelteKit <a class="header-anchor" href="#sveltekit" aria-label="Permalink to &quot;SvelteKit&quot;">​</a></h3><p>This example uses <a href="https://kit.svelte.dev" target="_blank" rel="noreferrer">SvelteKit</a>, the Svelte framework, with SSR via Lagoss&#39;s adapter. <a href="https://github.com/lagossapp/lagoss/tree/main/examples/sveltekit" target="_blank" rel="noreferrer">See the code</a></p>',60),l=[o];function h(i,n,p,c,d,m){return r(),a("div",null,l)}const f=e(s,[["render",h]]);export{g as __pageData,f as default};
